// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract UniversitySystem {
    address public admin; // L'administrateur du système

    constructor() {
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin /*"Seul l'administrateur peut effectuer cette opération"*/);
        _;
    }

    struct Student {
        uint id;
        string name;
        string surname;
        string gender;
        uint evaluation;
        address profileAgent; // Agent d'établissement qui peut créer un profil
    }

    struct Establishment {
        uint id;
        string name;
        string type_;
        address adminAgent; // Seul cet agent peut créer des comptes d'établissement
    }

    struct Diploma {
        uint id;
        uint studentId;
        uint establishmentId;
        string establishmentName;
        string type_;
        string mention;
    }

    struct Company {
        uint id;
        string name;
        string address_;
        address recruitmentAgent; // Seul cet agent peut créer un compte pour l'entreprise
    }

    mapping(address => Establishment) public establishmentAdmins;
    mapping(uint => Student) public students;
    mapping(uint => Diploma) public diplomas;
    mapping(uint => Company) public companies;

    function createEstablishment(uint _id, string memory _name, string memory _type) public onlyAdmin {
        establishmentAdmins[msg.sender] = Establishment(_id, _name, _type, msg.sender);
    }

    function createStudent(uint _id, string memory _name, string memory _surname, string memory _gender) public {
        Establishment storage establishment = establishmentAdmins[msg.sender];
        require(establishment.id > 0 /*"L'établissement n'existe pas ou n'a pas le droit de créer un profil"*/);
        students[_id] = Student(_id, _name, _surname, _gender, 0, msg.sender);
    }

    function addDiploma(uint _id, uint _studentId, string memory _establishmentName, string memory _type, string memory _mention) public {
        Establishment storage establishment = establishmentAdmins[msg.sender];
        require(establishment.id > 0 /*"L'établissement n'existe pas ou n'a pas le droit d'ajouter un diplôme"*/);
        require(students[_studentId].profileAgent == msg.sender /*"Seul l'établissement qui a créé le profil peut ajouter un diplôme"*/);
        diplomas[_id] = Diploma(_id, _studentId, establishment.id, _establishmentName, _type, _mention);
    }

    /*function insertEvaluation(uint _studentId, uint _evaluation) public {
        Company storage company = companies[msg.sender];
        require(company.id > 0 /*"L'entreprise n'existe pas ou n'a pas le droit d'insérer une évaluation");
        students[_studentId].evaluation = _evaluation;
    }*/

    function createCompany(uint _id, string memory _name, string memory _address) public {
        companies[_id] = Company(_id, _name, _address, msg.sender);
    }
}

